**Discord Bot with Ban Command using Discord.js v14**

### Prerequisites

- Node.js (14 or higher)
- Discord.js v14
- A Discord bot token

### Setup

1. **Install Dependencies**

   ```bash
   npm install discord.js
   ```

2. **Create a New Discord Bot**

   - Go to the [Discord Developer Portal](https://discord.com/developers/applications).
   - Create a new application.
   - Go to the "Bot" tab and click "Add Bot".
   - Under the "TOKEN" section, click "Copy".

3. **Create a New File for Your Bot**

   Create a new file named `index.js` in your project directory.

### Code

```javascript
// Import Discord.js
const { Client, CommandInteraction, SlashCommandBuilder } = require('discord.js');

// Create a new Discord client
const client = new Client({
  intents: [
    'Guilds',
    'GuildMembers',
    'GuildBans',
    'DirectMessages',
    'GuildMessages',
    'MessageContent',
  ],
});

// Define the ban command
const banCommand = new SlashCommandBuilder()
  .setName('ban')
  .setDescription('Ban a user from the server')
  .addUserOption((option) =>
    option.setName('user').setDescription('The user to ban').setRequired(true),
  )
  .addStringOption((option) =>
    option
      .setName('reason')
      .setDescription('The reason for the ban')
      .setRequired(false),
  );

// Register the ban command
client.commands.set(banCommand.toProperObject());

// Event listener for the ready event
client.on('ready', () => {
  console.log('Bot is online!');
});

// Event listener for the interactionCreate event
client.on('interactionCreate', async (interaction) => {
  if (!interaction.isCommand()) return;

  if (interaction.commandName === 'ban') {
    const user = interaction.options.getUser('user');
    const reason = interaction.options.getString('reason');

    if (!interaction.member.permissions.has('BAN_MEMBERS')) {
      await interaction.reply({
        content: 'You do not have permission to ban members.',
        ephemeral: true,
      });
      return;
    }

    if (interaction.guild.members.cache.get(user.id)) {
      await interaction.guild.members.ban(user, {
        reason: reason || 'No reason provided',
      });
      await interaction.reply({
        content: `User ${user.tag} has been banned.`,
        ephemeral: false,
      });
    } else {
      await interaction.reply({
        content: `User ${user.tag} is not in this server.`,
        ephemeral: true,
      });
    }
  }
});

// Login to Discord with your bot token
client.login('YOUR_BOT_TOKEN');
```

### Usage

1. **Replace `YOUR_BOT_TOKEN`** with your actual bot token.

2. **Run the bot** using `node index.js`.

3. **Use the ban command** by typing `/ban` in a Discord channel where the bot has permission to ban members.

### Notes

- This code uses the `SlashCommandBuilder` to create a new slash command.
- The `interactionCreate` event is used to handle interactions with the bot.
- The `ban` command checks if the user has the `BAN_MEMBERS` permission before banning a user.
- The `ban` command also checks if the user is in the server before banning them.

