**Power of Three Problem Solution in Java**

### Problem Description

Given an integer `n`, return `true` if it is a power of three. Otherwise, return `false`.

### Solution

```java
public class Solution {
    /**
     * Returns true if the given integer is a power of three, false otherwise.
     *
     * @param n the input integer
     * @return true if n is a power of three, false otherwise
     */
    public boolean isPowerOfThree(int n) {
        // Handle edge cases
        if (n <= 0) {
            return false;
        }

        // Use logarithm to check if n is a power of three
        return Math.log10(n) / Math.log10(3) % 1 == 0;
    }
}
```

### Explanation

This solution uses the mathematical property that a number `n` is a power of three if and only if its logarithm base three is an integer.

- We first handle edge cases where `n` is less than or equal to zero. In such cases, `n` cannot be a power of three.
- We then use the `Math.log10` function to calculate the logarithm base ten of `n`.
- We divide this result by the logarithm base ten of three (`Math.log10(3)`) to get the logarithm base three of `n`.
- We use the modulo operator (`%`) to check if the result is an integer. If it is, then `n` is a power of three.

### Example Use Cases

```java
public static void main(String[] args) {
    Solution solution = new Solution();

    // Example 1
    int n1 = 27;
    System.out.println(solution.isPowerOfThree(n1)); // Output: true

    // Example 2
    int n2 = 0;
    System.out.println(solution.isPowerOfThree(n2)); // Output: false

    // Example 3
    int n3 = -1;
    System.out.println(solution.isPowerOfThree(n3)); // Output: false
}
```

This solution is efficient and does not use loops or recursion. It directly calculates the logarithm base three of the input number to determine if it is a power of three.

