**Word Counter Program in C++**
=====================================

This program reads a text file line by line and counts the number of occurrences of a specific word.

**Code**
--------

```cpp
#include <iostream>
#include <fstream>
#include <sstream>
#include <string>
#include <map>

// Function to count word occurrences
int countWord(const std::string& word, const std::string& filename) {
    std::ifstream file(filename);
    if (!file.is_open()) {
        std::cerr << "Error: Unable to open file." << std::endl;
        return -1;
    }

    std::map<std::string, int> wordCount;
    std::string line, wordCopy;

    while (std::getline(file, line)) {
        std::istringstream iss(line);
        while (iss >> wordCopy) {
            // Convert to lowercase for case-insensitive comparison
            for (char& c : wordCopy) {
                c = std::tolower(c);
            }

            if (wordCopy == word) {
                ++wordCount[word];
            }
        }
    }

    file.close();
    return wordCount[word];
}

int main() {
    std::string filename, word;
    std::cout << "Enter the filename: ";
    std::cin >> filename;
    std::cout << "Enter the word to count: ";
    std::cin >> word;

    int count = countWord(word, filename);
    if (count != -1) {
        std::cout << "The word '" << word << "' appears " << count << " times in the file." << std::endl;
    }

    return 0;
}
```

**Explanation**
---------------

1.  The `countWord` function takes two parameters: the word to count and the filename.
2.  It opens the file and checks if it's successfully opened. If not, it prints an error message and returns -1.
3.  It uses a `std::map` to store the word count.
4.  It reads the file line by line and uses `std::istringstream` to split each line into words.
5.  It converts each word to lowercase for case-insensitive comparison.
6.  If a word matches the target word, it increments the count in the `std::map`.
7.  After processing all lines, it returns the word count.
8.  In the `main` function, it prompts the user to enter the filename and the word to count.
9.  It calls the `countWord` function and prints the result.

**Example Use Case**
--------------------

1.  Create a text file named `example.txt` with the following content:

    ```
